	router.GET(baseURL+"/simpleExplodeObject/:param", wrapper.GetSimpleExplodeObject, m...)
	router.GET(baseURL+"/simpleNoExplodeArray/:param", wrapper.GetSimpleNoExplodeArray, m...)
